import React from "react";

import classes from "./SiteButton.module.css";
import "../fonts/fonts.css";

const SiteButton = (props) => {
  return (
    <button
      className={classes.siteBtn}
      style={{
        backgroundColor: `${props.btnColor}`,
        color: `${props.textColor}`,
        width: `${props.width}`,
        top: `${props.top}`,
        left: `${props.left}`,
        trnasform: `translateX('${props.transX}')`,
      }}
    >
      <a href="https://sam-in95.github.io/web/mouse_pointer/" target="_blank">
        <p className={classes.siteBtnText}>SITE VIEW</p>
      </a>
    </button>
  );
};

export default SiteButton;
